import React from 'react';
import { Row, Col } from 'reactstrap';
import "../css/inbox.css";

export default function Inbox () {
    return (
        <div className="Inbox">
            <Row>
                <Col xl='4'>
                    <div className="inbox__left">

                    </div>
                </Col>
                <Col xl='8'>
                    <div className="inbox__right">

                    </div>
                </Col>
            </Row>
        </div>
    );
}
